#body_overlay{position:fixed;top:0;left:0;width:100%;height:120%;background:rgba(0,0,0,.6);z-index:9002;display:none;} /* height +20% - mobile fallback */

body.mobile-side-slide{position:relative;overflow-x:visible;}

#Side_slide{display:block;position:fixed;top:0px;right:-250px;max-width:100%;width:250px;height:100%;overflow:auto;border-bottom-width:60px;border-bottom-style:solid;z-index:99999;z-index:100000;} /* border-bottom:60px - mobile fallback */
#Side_slide.left{left:-250px;right:0}

#Side_slide .close-wrapper{height:60px}
#Side_slide .close-wrapper a.close{height:34px;width:34px;display:block;float:right;margin:13px 13px 0 0}
#Side_slide .close-wrapper a.close i{font-size:22px;line-height:34px;}

#Side_slide .extras{padding:0 20px}
#Side_slide .extras .action_button{width:100%;margin:0 0 20px;text-align:center;text-decoration:none}
#Side_slide .extras .action_button .button_label{float:none}

#Side_slide .extras .extras-wrapper{text-align:center;}
#Side_slide .extras .extras-wrapper a{display:inline-block;text-decoration:none;vertical-align:middle;padding:5px;margin-bottom:20px;line-height:22px}
#Side_slide .extras .extras-wrapper .icon{font-size:22px}

#Side_slide .extras .extras-wrapper .cart{position:relative}
#Side_slide .extras .extras-wrapper .cart span{position:absolute;top:0;left:31px;font-size:11px;border-radius:2px}

#Side_slide .extras .extras-wrapper a.lang-active img{position:relative;top:2px;}
#Side_slide .extras .extras-wrapper a.lang-active i:before{width:auto;margin-left:5px}

#Side_slide #menu{display:block!important;margin-bottom:20px;max-height:none!important}
#Side_slide #menu ul{width:100%!important;}
#Side_slide #menu ul li{width:100%;position:relative;border-top:1px solid rgba(255,255,255,.03)}
#Side_slide #menu > ul:last-child > li:last-child{border-bottom:1px solid rgba(255,255,255,.03)}
#Side_slide #menu ul li a{display:block;padding:11px 5px 10px 20px;margin-right:50px;text-decoration:none;line-height:19px}
#Side_slide #menu ul li a span.description{display:block;opacity:.5}
#Side_slide #menu ul li a .menu-arrow{display:none}
#Side_slide #menu ul li ul{display:none;background:rgba(255,255,255,.025)}
#Side_slide #menu ul li ul li a{padding-left:35px}
#Side_slide #menu ul li ul li ul li a{padding-left:50px}

#Side_slide #menu ul li.submenu .menu-toggle{display:block;position:absolute;right:5px;top:0;width:40px;height:40px;line-height:40px;font-size:22px;font-weight:100;text-align:center;cursor:pointer;opacity:0.5;}
#Side_slide #menu ul li.submenu .menu-toggle:after{content:"+"}
#Side_slide #menu ul li.hover > .menu-toggle{opacity:1}
#Side_slide #menu ul li.hover > .menu-toggle:after{content:"-"}

#Side_slide #menu ul.hkd-megamenu-bg{background-image:none!important}
#Side_slide #menu ul.hkd-megamenu li .menu-toggle{display:none}
#Side_slide #menu ul.hkd-megamenu > li > ul{display:block!important}

#Side_slide #menu ul.hkd-megamenu > li > ul:first-child {background-color:transparent}
#Side_slide #menu ul.hkd-megamenu > li > ul:first-child > li:first-child{border-top-width:0}

#Side_slide .menu.menu-mobile{display:none}

#Side_slide .lang-wrapper{margin-bottom:20px;text-align:center;display:none;}
#Side_slide .lang-wrapper ul li{border-top:1px solid rgba(255,255,255,.03)}
#Side_slide .lang-wrapper ul li:last-child{border-bottom:1px solid rgba(255,255,255,.03)}
#Side_slide .lang-wrapper ul li a{display:block;padding:11px 20px 10px 20px;text-decoration:none;line-height:19px}

#Side_slide .search-wrapper{margin-bottom:20px;position:relative;display:none;}
#Side_slide .search-wrapper input.field{width:100%;background:none!important;border-width:1px 0 1px 0;border-color:rgba(255,255,255,.05);line-height:20px;padding:10px 55px 10px 20px;box-sizing:border-box;box-shadow:0 0 0 0 transparent;}
#Side_slide .search-wrapper a.submit{position:absolute;top:0;right:5px;font-size:20px;padding:10px}

#Side_slide .social{text-align:center;margin:0 20px 13px}
#Side_slide .social li{display:inline-block}
#Side_slide .social li a{display:block;padding:3px 5px;text-decoration:none}

/* Side Slide | Hide */
#Side_slide.hide-button .extras .action_button{display:none}
#Side_slide.hide-icons .extras .extras-wrapper{display:none}
#Side_slide.hide-social .social{display:none!important}

/* Side Slide | Color */
#Side_slide{background-color:#191919;border-color:#191919} /* border-bottom:60px - mobile fallback */

#Side_slide,
#Side_slide .search-wrapper input.field,
#Side_slide a:not(.button),
#Side_slide #menu ul li.submenu .menu-toggle{color:#a6a6a6}

#Side_slide a:not(.button):hover,
#Side_slide a.active,
#Side_slide #menu ul li.hover > .menu-toggle{color:#ffffff;}

#Side_slide #menu ul li.current-menu-item > a,#Side_slide #menu ul li.current_page_item > a,
#Side_slide #menu ul li.current-menu-parent > a,#Side_slide #menu ul li.current-page-parent > a,
#Side_slide #menu ul li.current-menu-ancestor > a,#Side_slide #menu ul li.current-page-ancestor > a,#Side_slide #menu ul li.current_page_ancestor > a,
#Side_slide #menu ul li.hover > a,#Side_slide #menu ul li:hover > a{color:#ffffff;}

/* Side Slide | Light */
#Side_slide.light #menu ul li{border-top-color:rgba(0,0,0,.03)}
#Side_slide.light #menu > ul:last-child > li:last-child{border-bottom-color:rgba(0,0,0,.03)}
#Side_slide.light #menu ul li ul{background:rgba(0,0,0,.02)}
#Side_slide.light .lang-wrapper ul li{border-top-color:rgba(0,0,0,.03)}
#Side_slide.light .lang-wrapper ul li:last-child{border-bottom-color:rgba(0,0,0,.03)}
#Side_slide.light .search-wrapper input.field{border-color:rgba(0,0,0,.05)}

/* Subheader ------------------------------------------------------------------------- */
#Subheader{background-color:rgba(0,0,0,.02);background-position:center top;background-repeat:no-repeat;padding:30px 0;position:relative}
.subheader-transparent #Subheader{background:none}
.hide-title-area #Subheader{display:none}
#Subheader .column{margin-bottom:0}
#Subheader .title{margin-bottom:0;width:70%;float:left}
#Subheader ul.breadcrumbs{display:block;width:30%;margin:1px 0 0;font-size:1em!important;float:right;text-align:right}
#Subheader ul.breadcrumbs li{display:inline-block}
#Subheader ul.breadcrumbs li,#Subheader ul.breadcrumbs li a{color:rgba(0,0,0,.3)}
#Subheader ul.breadcrumbs li span{margin:0 10px;opacity:.4;filter:alpha(opacity=40)}
#Subheader:after{content:"";height:3px;width:100%;display:block;position:absolute;left:0;bottom:-3px;z-index:1;background:url(/8bf548cc42bf2004de4c0f91781fe88a.png) repeat-x left top}
#Subheader ul.woocommerce-breadcrumb li:last-child span{display:none}

	/* style */
	.subheader-title-right #Subheader .title{float:right;text-align:right}
	.subheader-title-right #Subheader .breadcrumbs{float:left;text-align:left}
	.subheader-both-left #Subheader .title{width:100%}
	.subheader-both-left #Subheader .breadcrumbs{width:100%;text-align:left;margin-top:10px}
	.subheader-both-right #Subheader .title{width:100%;text-align:right}
	.subheader-both-right #Subheader .breadcrumbs{width:100%;text-align:right;margin-top:10px}
	.subheader-both-center #Subheader .title{width:100%;text-align:center}
	.subheader-both-center #Subheader .breadcrumbs{width:100%;text-align:center;margin-top:10px}

/* Intro ------------------------------------------------------------------------- */
#Intro{text-align:center;position:relative;background-color:#000119;background-position:center top;}
#Intro .intro-inner{position:relative;padding:250px 10%}
#Intro .intro-title{margin-bottom:20px;word-wrap:break-word}
#Intro .intro-meta > div{display:inline-block;margin:0 10px}
#Intro .intro-next{cursor:pointer;font-size:38px;height:50px;left:50%;bottom:30px;line-height:50px;margin:0 0 0 -25px;position:absolute;text-align:center;width:50px;z-index:1;-webkit-transition:all .3s ease-in-out;transition:all .3s ease-in-out}

#Intro.parallax{overflow:hidden}
#Intro.parallax .hkd-parallax{position:absolute;left:0;top:0;max-width:auto!important;transition:opacity .2s;}

/* Light */
#Intro .intro-title{color:#fff}
#Intro .intro-meta,#Intro .intro-meta a{color:rgba(255,255,255,.7)}
#Intro .intro-next{color:rgba(255,255,255,0.2)}
#Intro .intro-next:hover{color:rgba(255,255,255,0.5)}

/* Dark */
#Intro.light .intro-title{color:#212121}
#Intro.light .intro-meta,#Intro.light .intro-meta a{color:rgba(33,33,33,.7)}
#Intro.light .intro-next{color:rgba(33,33,33,0.2)}
#Intro.light .intro-next:hover{color:rgba(33,33,33,0.5)}
	

/* Post ------------------------------------------------------------------------------ */
.post-item{margin-bottom:40px;position:relative;float:left;width:100%}
.post-item .date_label{position:absolute;left:0;top:7px;display:none}
.post-photo-wrapper{width:37%;float:left}
.post-photo-wrapper iframe{width:100%}
.post-desc-wrapper{width:63%;float:left}
.post-desc{padding:15px 0 0 20px}

.post.no-img .post-photo-wrapper{display:none}
.post.no-img .post-desc-wrapper{width:100%}

.search-results .no-img .post-desc{padding-left:0}
.search-results .no-img .post-desc-wrapper{width:100%}

	.post-meta{margin-bottom:8px}
	.post-meta .author-date{float:left}
	.post-meta .author-date a{border-bottom-width:1px;border-style:dotted;text-decoration:none!important}
	.post-meta .category{float:right;position:relative}
	.post-meta .category.mata-tags{margin-right:10px}
	.post-meta .category .cat-btn{cursor:pointer}
	.post-meta .category .cat-wrapper{position:absolute;right:0;top:100%;display:none;z-index:21}
	.post-meta .category:hover .cat-wrapper{display:block}
	.post-meta .category .cat-wrapper ul{padding:7px;min-width:70px;background:#F9F9F9}
	.post-meta .category .cat-wrapper ul li{border-bottom:1px solid rgba(0,0,0,0.05)}
	.post-meta .category .cat-wrapper ul li:last-child{border-bottom:0}
	.post-meta .category .cat-wrapper ul li a{display:block;text-align:center;padding:1px 5px;color:#8B8B8B}
	.post-meta .category .cat-wrapper ul li a:hover{text-decoration:none;color:#5F5F5F;background:rgba(255,255,255,0.8)}

	.post-excerpt{margin-bottom:15px}
	.cat_description{margin-bottom:40px}
	
	.post-footer{background:rgba(0,0,0,.02);padding:7px 15px;overflow:hidden;line-height:30px}
	.post-footer .button-love{float:left}
	.post-footer .button-love a.hkd-love{display:inline-block;position:relative;padding-left:24px;margin-left:5px}
	.post-footer .button-love a.hkd-love i{position:absolute;left:0;top:0;font-size:16px}
	.post-footer .button-love a.hkd-love:hover{text-decoration:none}
	.post-footer .button-love a.hkd-love i:last-child{opacity:0;filter:alpha(opacity=0);-webkit-transition:all .3s ease-in-out;-moz-transition:all .3s ease-in-out;-o-transition:all .3s ease-in-out;-ms-transition:all .3s ease-in-out;transition:all .3s ease-in-out}
	.post-footer .button-love a:hover.hkd-love i:last-child,.post-footer .button-love a.loved.hkd-love i:last-child{opacity:1;filter:alpha(opacity=100)}
	.post-footer .post-links{float:right;border-left-width:1px;border-style:solid;padding-left:10px}
	.post-footer .post-links .post-comments{margin-right:10px}
	
	.hide-more .post-footer .post-links .icon-doc-text,.hide-more .post-footer .post-links .post-more{display:none}
	.blog_slider.hide-more .item_wrapper .hr_color,.blog_slider.hide-more .item_wrapper .button{display:none}
	
		/* Grid */
		.grid .post-item { width: 31.33%; margin: 0 1% 20px; background: #fff !important; }
		.grid .post-photo-wrapper { width: 100%; float: none; }
		.grid .post-desc-wrapper { width: 100%; float: none; }
		.grid .post-desc-wrapper .post-desc { padding: 20px 20px 0; }
		.grid .post-footer { margin: 0 -20px; -webkit-box-sizing: border-box; -moz-box-sizing: border-box; box-sizing: border-box; }
			.grid .post-meta .author-date .author span.label { display: none; }
			.grid .post-desc-wrapper .post-meta .category .cat-btn { display: none; }
			.grid .post-desc-wrapper .post-footer .button-love .love-text { display: none; }
			
			/* Columns 2-6 */
			.posts_group.grid.col-2 .post-item { width: 47.99%;}			
			.posts_group.grid.col-3 .post-item { width: 31.33%;}			
			.posts_group.grid.col-4 .post-item { width: 22.99%;}
			.posts_group.grid.col-5 .post-item { width: 18.99%; margin: 0 0.5% 20px;}
			.posts_group.grid.col-6 .post-item { width: 15.66%; margin: 0 0.5% 20px;}
			
			.posts_group.grid.col-2 .post-item:nth-child(2n+1) { clear:both; }
			.posts_group.grid.col-3 .post-item:nth-child(3n+1) { clear:both; }
			.posts_group.grid.col-4 .post-item:nth-child(4n+1) { clear:both; }
			.posts_group.grid.col-5 .post-item:nth-child(5n+1) { clear:both; }
			.posts_group.grid.col-6 .post-item:nth-child(6n+1) { clear:both; }
						
		/* Masonry */
		.masonry:not(.tiles) .post-item { width: 31.33%; margin: 0 1% 20px; background: #fff !important; }
		.masonry .post-photo-wrapper { width: 100%; float: none; }
		.masonry .post-desc-wrapper { width: 100%; float: none; }
		.masonry .post-desc-wrapper .post-desc { padding: 20px 20px 0; }
		.masonry .post-footer { margin: 0 -20px; -webkit-box-sizing: border-box; -moz-box-sizing: border-box; box-sizing: border-box; }
			.masonry .post-meta .author-date .author span.label { display: none; }
			.masonry .post-desc-wrapper .post-meta .category .cat-btn { display: none; }
			.masonry .post-desc-wrapper .post-footer .button-love .love-text { display: none; }
			
			/* Columns 2-6 */
			.posts_group.masonry.col-2 .post-item { width: 47.99%;}			
			.posts_group.masonry.col-3 .post-item { width: 31.33%;}			
			.posts_group.masonry.col-4 .post-item { width: 22.99%;}
			.posts_group.masonry.col-5 .post-item { width: 18.99%; margin: 0 0.5% 20px;}
			.posts_group.masonry.col-6 .post-item { width: 15.66%; margin: 0 0.5% 20px;}
			
		/* Masonry tiles */
		.masonry.tiles { position: relative; }
		.masonry.tiles .post-item { margin: 0 !important; overflow: hidden; background-color: transparent; }
		.masonry.tiles .post-item:not(.no-img) .post-desc-wrapper { position: absolute; z-index: 4; left: 0; bottom: -20px; }
		.masonry.tiles .post-item:not(.no-img) .post-desc-wrapper .post-desc { background: url(/e5c7f015e458333035f9c5214d9f64d9.png) top left repeat-x; padding: 70px 30px 30px; }
		.masonry.tiles .post-item .post-desc-wrapper .post-desc { padding: 50% 30px 10px; } 
		.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-meta .author-date .post-links { display: inline-block; margin-left: 10px; }
		.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-excerpt { display: none; }
		
			/* Photo wrapper */
			.masonry.tiles .post-item:not(.no-img) .post-photo-wrapper { line-height: 0; position: relative; }
			.masonry.tiles .post-item:not(.no-img) .post-photo-wrapper:after { content: ""; position: absolute; z-index: 2; left: 0; top: 0; width: 100%; height: 100%; background: rgba(0,0,0,.2); opacity: 0; transition: all 0.6s ease-out; }
			.masonry.tiles .post-item:not(.no-img):hover .post-photo-wrapper:after { opacity: 1; }
		
			/* Posts */
			.masonry.tiles .format-link .post-title .icon-link { display: none; }
			.masonry.tiles .format-link .post-title .link-wrapper { margin-left: 0; padding-top: 5px; }
			.masonry.tiles .format-quote blockquote { margin-left: 0; top: 0; margin-bottom: 25px; }
			.masonry.tiles .format-quote blockquote:after { display: none; }
			.masonry.tiles .format-quote blockquote a { text-decoration: none; }
		
			/* Post icon */
			.masonry.tiles .post-item .post-format-icon { position: absolute; z-index: 3; left: 25px; top: 25px; font-size: 35px; line-height: 35px; color: #fff; }
		
			/* Line */
			.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-title:after { content: ""; display: block; height: 3px; margin-top: 20px; width: 0; transition: all 0.4s ease-out; }
			.masonry.tiles .post-item:hover .post-desc-wrapper .post-desc .post-title:after { width: 40%; }
			
			/* Desc wrapper animation */
			.masonry.tiles .post-item .post-desc-wrapper { transition: all 0.4s ease-out; }
			.masonry.tiles .post-item:hover .post-desc-wrapper { transform: translateY(-20px); }
		
			/* Columns 2-6 */
			.posts_group.masonry.tiles.col-2 .post-item { width: 49.99%; }			
			.posts_group.masonry.tiles.col-3 .post-item { width: 33.33%; }			
			.posts_group.masonry.tiles.col-4 .post-item { width: 24.99%; }
			.posts_group.masonry.tiles.col-5 .post-item { width: 19.99%; }
			.posts_group.masonry.tiles.col-6 .post-item { width: 16.66%; }
			
			/* With margin */
			.posts_group.masonry.margin .post-item { margin:0 1% 25px !important;}			
			.posts_group.masonry.margin.col-2 .post-item { width: 47.99%;}			
			.posts_group.masonry.margin.col-3 .post-item { width: 31.33%;}			
			.posts_group.masonry.margin.col-4 .post-item { width: 22.99%;}
			.posts_group.masonry.margin.col-5 .post-item { width: 18.99%; margin:0 0.5% 12px !important;}
			.posts_group.masonry.margin.col-6 .post-item { width: 15.66%; margin:0 0.5% 12px !important;}

			/* Colors */
			.masonry.tiles .post-item.format-quote blockquote,
			.masonry.tiles .post-item.format-quote blockquote a,
			.masonry.tiles .post-item.format-link .post-title .icon-link,
			.masonry.tiles .post-item.format-link .post-title .link-wrapper h4,
			.masonry.tiles .post-item.format-link .post-title .link-wrapper a,
			.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-title .entry-title a { color: #fff; }
			
			.masonry.tiles .post-item.no-img .post-desc-wrapper .post-desc .post-title:after,
			.masonry.tiles .post-item.format-quote .post-desc-wrapper .post-desc .post-title:after,
			.masonry.tiles .post-item.format-link .post-desc-wrapper .post-desc .post-title:after { background-color: #fff; }
			
			.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-head .post-meta,
			.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-head .post-meta a,
			.masonry.tiles .post-item .post-desc-wrapper .post-desc .post-excerpt { color: rgba(255,255,255,.7); }

		/* Timeline */
		.timeline .post-item { float:none; width:auto; padding-left: 200px; margin-bottom: 0; padding-bottom: 40px; background: url(/c13da784e1dddd9d57e4c560158abe2e.png) no-repeat 90px top; }
		.timeline .post-item:last-child { padding-bottom: 20px; margin-bottom: 20px; }
		.timeline .format-quote .post-meta,
		.timeline .format-link .post-meta { padding-top: 7px; }
		.timeline .post-item:before { content: ""; width: 7px; height: 7px; border-width: 4px; border-style: solid; -webkit-border-radius: 100%; border-radius: 100%; position: absolute; left: 126px; top: 11px; display: block; visibility: visible; z-index: 1; }
		.timeline .date_label { display: block; }
		.timeline .post-meta .author-date .date{ display: none; }
		
		/* Photo */
		.photo .post-item  { float:none; }
		.photo .post-photo-wrapper { width: 100%; float: none; }
		.photo .post-desc-wrapper { width: 100%; float: none; text-align: center; }
		.photo .post-desc .post-head {}
		.photo .post-desc .post-head .post-meta { display: inline-block; }
		.photo .post-desc .post-head .post-footer { display: inline-block; background: none; padding: 0; line-height: inherit; }
		.photo .post-desc .post-title {}
		.photo .post-desc .post-excerpt { margin-bottom: 0; }
		
			.photo .post-desc .post-head .post-meta .author-date,
			.photo .post-desc .post-head .post-meta .category,
			.photo .post-desc .post-head .post-footer .button-love,
			.photo .post-desc .post-head .post-footer .post-links { float: none; display: inline-block; }

			.photo .post-desc .post-head .post-meta .author-date { margin-right: 20px; }
			.photo .post-desc .post-head .post-meta .author-date .label { display: none; }
			.photo .post-desc .post-head .post-footer .button-love { margin-right: 20px; }
			.photo .post-desc .post-head .post-footer .button-love .love-text { display: none; }
			.photo .post-desc .post-head .post-footer .post-links { border: 0; padding: 0; }
			.photo .post-desc .post-head .post-footer .post-links .icon-doc-text,
			.photo .post-desc .post-head .post-footer .post-links .post-more { display: none; }
			
			.photo .format-image { text-align: center; }
			.photo .format-image .post-photo-wrapper { display: inline-block; width: auto; }
			.photo .format-link .post-title { display: inline-block; text-align: left; }

	/* Post types */
	.format-quote .post-photo-wrapper{display:none}
	.format-quote .post-desc{padding:0}
	.format-quote .post-desc-wrapper{width:100%;float:none}
	
	.format-video .image_frame .image_wrapper img{margin-bottom:0!important}
	.format-video .image_frame:hover .image_wrapper img{top:0}
	
	.format-link .post-photo-wrapper{display:none}
	.format-link .post-desc-wrapper{width:100%;float:none}
	.format-link .post-desc{padding:0}
	.format-link .post-title{overflow:hidden}
