/* Respond -------------------------------------------------------------------------- */
#respond{overflow:hidden;margin-bottom:40px}
#respond .comment-reply-title{font-size:21px;line-height:25px}
#respond p{margin-bottom:15px;padding-left:0!important}
#respond .comment-notes .required{position:static}
#respond input[type="text"]{margin-bottom:0}
#respond label{margin-bottom:3px}
#respond .comment-form-author{width:31.3%;margin-right:2%!important;float:left;position:relative}
#respond .comment-form-email{width:31.3%;margin-right:2%!important;float:left;position:relative}
#respond .comment-form-url{width:33.3%;float:left;position:relative}
#respond input[type="text"],#respond input[type="password"],#respond input[type="email"],#respond select{width:100%}
#respond .comment-form-comment{width:100%}
#respond .comment-form-comment textarea{width:100%;margin-bottom:10px}
#respond .form-submit{margin:0}
#respond .form-submit input[type="submit"]{float:right!important;margin:0!important}
#respond .form-allowed-tags{display:none}
#respond .form-allowed-tags code{margin-top:10px}

/* Testimonials | Single | @you should not see this page ----------------------------- */
.single-testimonial .post-nav,.single-testimonial .post-meta .category,.single-testimonial .fixed-nav{display:none}

/* Error 404 | #Error_404 ------------------------------------------------------------ */
body.error404{height:100%}
body.error404.custom-404,body.error404.events-archive{height:auto}
body.error404:not(.events-archive) #Content{padding:0!important}

#Error_404{overflow:hidden;position:absolute;top:50%;margin-top:-150px;left:30px}
#Error_404 .error_pic{width:30%;float:left;text-align:center}
#Error_404 .error_pic i{font-size:250px;line-height:250px}
#Error_404 .error_desk{width:70%;float:left;padding-top:40px}
#Error_404 .error_desk h2{font-size:45px;line-height:45px}
#Error_404 .error_desk h4{font-size:26px;line-height:30px}
#Error_404 .error_desk p .check{line-height:45px;font-size:16px}
#Error_404 .error_desk p .button{margin:0;display:inline;margin-left:20px}

/* Search Results | .search-not-found ------------------------------------------------ */
.search-not-found .snf-pic{float:left;text-align:center;width:275px}
.search-not-found .snf-pic i{font-size:200px;line-height:200px}
.search-not-found .snf-desc{width:70%;width:calc(100% - 275px);float:left;padding-top:40px}
.search-not-found .snf-desc h2{font-size:45px;line-height:45px;color:rgba(0,0,0,.7)}
.search-not-found .snf-desc h4{font-size:26px;line-height:30px;color:rgba(0,0,0,.7)}

/* Video Section --------------------------------------------------------------------- */
.section.has-video{position:relative;overflow:hidden}
.section.has-video .section_video{position:absolute;top:0;left:0;min-height:100%;min-width:100%;overflow:hidden;z-index:1}
.section.has-video .section_video .mask{position:absolute;top:0;left:0;height:100%;width:100%;z-index:3;background:url(/7cdeb3a9d337e4c9781a436096d24bca.png) repeat center}
.section.has-video .section_video video{position:absolute;top:0;left:0;min-height:100%;min-width:100%;z-index:2}
.section.has-video .section_wrapper{position:relative;z-index:10}
@media only screen and (max-device-width:1024px) {
	.section.has-video .section_video{display:none!important}
}

/* Section Navigation ---------------------------------------------------------------- */
.section.has-navi .section-nav{position:absolute;left:50%;z-index:701;cursor:pointer;font-size:38px;width:50px;height:50px;line-height:50px;margin:0 0 0 -25px;text-align:center;color:rgba(0,0,0,.2)}
.section.has-navi .section-nav:hover{color:rgba(0,0,0,.8)}
.section.has-navi .section-nav.prev{top:25px}
.section.has-navi .section-nav.next{bottom:25px}
.section.has-navi:first-child .section-nav.prev,.section.has-navi:nth-last-child(3) .section-nav.next{display:none}
.section.has-navi .section-nav{color:rgba(0,0,0,.2)}
.section.has-navi .section-nav:hover{color:rgba(0,0,0,.8)}
.section.has-navi.dark .section-nav{color:rgba(255,255,255,.2)}
.section.has-navi.dark .section-nav:hover{color:rgba(255,255,255,.8)}
.section.has-navi .section-nav{-webkit-transition:all .5s ease-in-out;-moz-transition:all .5s ease-in-out;-o-transition:all .5s ease-in-out;transition:all .5s ease-in-out}

/* Dark ------------------------------------------------------------------------------ */
.dark,.dark ul.timeline_items,.dark .icon_box a .desc,.dark .icon_box a:hover .desc,.dark .feature_list ul li a,.dark .list_item a,.dark .list_item a:hover,.dark .widget_recent_entries ul li a{color:#fff!important}
.dark .ui-tabs .ui-tabs-panel,.dark .accordion .question .answer{color:#626262}

/* Blockquote */
.dark blockquote{background-image:url(/62ffdec349d45cd7cadb279a336aa5cf.png)}
.dark blockquote:after{background-image:url(/d5ee583c88ac0893c690e15bd3610ff2.png)}

/* Headings font */
.dark h1,.dark h1 a,.dark h1 a:hover{color:#fff}
.dark h2,.dark h2 a,.dark h2 a:hover{color:#fff}
.dark h3,.dark h3 a,.dark h3 a:hover{color:#fff}
.dark h4,.dark h4 a,.dark h4 a:hover{color:#fff}
.dark h5,.dark h5 a,.dark h5 a:hover{color:#fff}
.dark h6,.dark h6 a,.dark h6 a:hover,.dark a.content_link .title{color:#fff}

/* Borders */
.dark .idea_box,.dark table th,.dark table td,.dark .list_item .circle,.dark
input[type="text"],.dark input[type="tel"],.dark input[type="password"],.dark input[type="email"],.dark textarea,.dark select,.dark .promo_box.has_border:after,.dark
dl > dt,.dark dl > dd,.dark .article_box .desc_wrapper p,.dark a.icon_bar,.dark a.content_link,.dark .how_it_works .image,.dark .opening_hours,.dark .opening_hours .opening_hours_wrapper li,.dark
.icon_box.has_border:after,.dark .chart_box:before,.dark .pricing-box,.dark .team_list .bq_wrapper,.dark .post-footer .post-links,.dark .format-link .post-title .icon-link,.dark
.share_wrapper,.dark .post-header .title_wrapper,.dark .section-post-related .section-related-adjustment,.dark .comments,.dark .widget-area,.dark .widget:after,.dark
.fixed-nav .desc h6,.dark .portfolio_group.list .portfolio-item,.dark .portfolio_group .portfolio-item .desc .details-wrapper,.dark .Recent_posts ul li .desc h6,.dark
.widget_recent_entries ul li a,.dark .woocommerce .widget_best_sellers li,.dark .woocommerce .widget_featured_products li,.dark .woocommerce .widget_recent_reviews li,.dark .woocommerce .widget_recent_products li,.dark .woocommerce .widget_recently_viewed_products li,.dark .woocommerce .widget_random_products li,.dark .woocommerce .widget_top_rated_products li,.dark
.woocommerce .widget_onsale li,.dark .woocommerce .widget_layered_nav li,.dark .woocommerce .widget_shopping_cart ul.product_list_widget li,.dark
.woocommerce .widget_products li,.dark .woocommerce .product .related.products,.dark .woocommerce .product div.entry-summary h1.product_title:after,.dark
.woocommerce .quantity input.qty{border-color:rgba(255,255,255,.08)}

/* Grey */
.dark .blockquote p.author span,.dark .counter .desc_wrapper .title,.dark .article_box .desc_wrapper p,.dark .team .desc_wrapper p.subtitle,.dark .pricing-box .plan-header p.subtitle,.dark .pricing-box .plan-header .price sup.period,.dark .chart_box p,.dark .fancy_heading .inside,.dark
.fancy_heading_line .slogan,.dark .post-meta,.dark .post-meta a,.dark .post-footer,.dark .post-footer a span.label,.dark .pager .pages a,.dark .button-love a .label,.dark
.pager-single a,.dark #comments .commentlist > li .comment-author .says,.dark .fixed-nav .desc .date,.dark .filters_buttons li.label,.dark .Recent_posts ul li a .desc .date,.dark
.widget_recent_entries ul li .post-date,.dark .tp_recent_tweets .twitter_time,.dark .widget_price_filter .price_label,.dark .shop-filters .woocommerce-result-count,.dark
.woocommerce ul.product_list_widget li .quantity,.dark .widget_shopping_cart ul.product_list_widget li dl,.dark .product_meta .posted_in,.dark
.woocommerce .shop_table .product-name .variation > dd,.dark .shipping-calculator-button:after,.dark .shop_slider .shop_slider_ul li .item_wrapper .price del,.dark
.testimonials_slider .testimonials_slider_ul li .author span,.dark .testimonials_slider .testimonials_slider_ul li .author span a{color:#DEDEDE}

/* Dividers */
.dark hr{background-color:rgba(255,255,255,.08);color:rgba(255,255,255,.08)}

/* Others */
.dark blockquote{color:#fff}
.dark .article_box .desc_wrapper h4{color:#444}
.dark .progress_bars .bars_list li h6 .label{color:rgba(255,255,255,0.35);background:rgba(255,255,255,0.05)}
.dark .faq .question .title{color:#fff}
.dark .counter .desc_wrapper .number{color:#fff}
.dark a.content_link .title{color:#444}
.dark .opening_hours,.dark .opening_hours h3{color:#444}
.dark .Recent_posts ul li .desc{background:rgba(0,0,0,.1)}

/* Pricing box */
.dark .pricing-box-box{background:rgba(0,0,0,0.1)}
.dark .pricing-box .plan-inside ul li{border-bottom:1px solid rgba(255,255,255,0.1)}

/* Lists */
.dark .column_column ul,.dark .column_column ol,.dark .the_content_wrapper ul,.dark .the_content_wrapper ol{color:#fff}
.dark .list_item.lists_2 .list_icon i{color:#fff}

/* Pricing table */
.dark .pricing-box-table.pricing-box-featured{background:rgba(0,0,0,.1)}
.dark .pricing-box .plan-header .price sup.period{color:rgba(255,255,255,0.5)!important}

/* Call to action */
.dark .call_to_action .call_left h3{color:rgba(0,0,0,.65)}
.dark .call_to_action .call_center a{color:#fff}

/* Fancy heading */
.dark .fancy_heading_line{background-image:url(/0b7ddd1f5dfbba0fee08ec0026061863.png)}

/* Content slider */
.dark .content_slider.flat a.button .button_icon i{color:#fff}

/* Fancy links */
.dark a.hkd-link,.dark a:hover.hkd-link{color:#fff}
.dark a.hover.hkd-link-2 span:before,.dark a.hkd-link-8:after,.dark a.hkd-link-8:before{background:#fff}
.dark a.hkd-link-4:hover:before,.dark a.hkd-link-4:hover:after,.dark a.hover.hkd-link-4:before,.dark a.hover.hkd-link-4:after,.dark a.hkd-link-7:after,.dark a.hkd-link-7:before{background:#fff}
.dark a.hkd-link-6:before{border-bottom-color:#fff}

/* Pagination */
.dark .slider_pagination a{background:rgba(255,255,255,0.3)}

sources.layoutEFB996ver=18.css:
/* Global ---------------------------------------------------------------------------- */
.rev_slider iframe{max-width:1220px}
.rev_slider ul{margin:0!important}
.tp-static-layers{z-index:200}
#hkd-layer-slider{position:relative;z-index:28}
#hkd-layer-slider .ls-yourlogo{z-index:29}

/* Section --------------------------------------------------------------------------- */
.section[data-parallax="3d"]{overflow:hidden}
.section .hkd-parallax{position:absolute;left:0;top:0;max-width:none!important;transition:opacity .2s;}
.wrap[data-parallax="3d"]{overflow:hidden;position:relative}
.wrap[data-parallax="3d"] > .mcb-wrap-inner,.wrap[data-parallax="3d"] > .column{position:relative}
.section.center{text-align:center}
.section.no-margin .column,.section.no-margin-v .column{margin-bottom:0}
.the_content_wrapper pre{margin-bottom:20px}

/* Transparent ----------------------------------------------------------------------- */
.tr-content #Wrapper,.tr-content #Content{background:none}
.tr-header #Wrapper{background:none}
.tr-header #Header_wrapper{background:none!important}
.tr-footer #Wrapper{background:none}
.tr-footer #Footer{background:none!important}

/* No Shadow ------------------------------------------------------------------------- */
.no-shadows #Wrapper,.no-shadows #Top_bar.is-sticky,.no-shadows #Header_creative,
.no-shadows input[type="date"],.no-shadows input[type="email"],.no-shadows input[type="number"],.no-shadows input[type="password"],.no-shadows input[type="search"],.no-shadows input[type="tel"],
.no-shadows input[type="text"],.no-shadows input[type="url"],.no-shadows select,.no-shadows textarea,.no-shadows .woocommerce .quantity input.qty{box-shadow:0 0 0 transparent;-webkit-box-shadow:0 0 0 transparent}
.no-shadows #Wrapper{overflow:visible}
.no-shadows #Subheader:after{display:none}

/* Blank & Under Construction -------------------------------------------------------- */
.page.hide-title-area #Content,.no-content-padding #Content,.template-blank #Content,.under-construction #Content{padding:0!important}
.with_aside.page.hide-title-area .sections_group,.with_aside.no-content-padding .sections_group{padding:0!important}
.under-construction .section-uc-1{padding-top:40px;background-color:#fff}
.under-construction .section-uc-2{padding-top:40px;background-color:#f5f5f5;background:url(../images/stripes/stripes_3_b.png) repeat center}
.under-construction .section-uc-3{padding-top:40px}
.under-construction .section-border-top{border-top:1px solid rgba(0,0,0,0.08)}

/* Nice Scroll | .nice-scroll -------------------------------------------------------- */
body.nice-scroll{position:relative}
body.nice-scroll:not(.layout-boxed){padding-right:10px!important}
.nice-scroll #configurator,.nice-scroll #Sliding-top a.sliding-top-control,.nice-scroll .fixed-nav.fixed-nav-next{margin-right:10px}
.nice-scroll .nicescroll-rails{background:#666;z-index:9002!important}

/* Slider | Pagination --------------------------------------------------------------- */
.slider_pagination{text-align:center;line-height:0}
.slider_pagination a{display:inline-block;width:12px;height:12px;text-indent:-9999px;margin:0 9px;background:rgba(0,0,0,.15);-webkit-border-radius:100%;border-radius:100%;position:relative;cursor:pointer}
.slider_pagination a:hover{background:rgba(0,0,0,.25)}

.slider_pagination a.selected,
.slider_pagination .slick-active a{width:10px;height:8px;margin:0 10px;position:relative;top:4px;background:rgba(0,0,0,.15);-webkit-border-radius:2px;border-radius:2px}

.slider_pagination a.selected:after,
.slider_pagination .slick-active a:after{content:"";display:block;width:8px;height:8px;-webkit-border-radius:1px;border-radius:1px;position:absolute;left:1px;top:-3px;background:#D6D6D6;-webkit-transform:rotate(45deg);transform:rotate(45deg)}
	
/* Slider Revolution ----------------------------------------------------------------- */
#hkd-rev-slider input{display:inline-block}
	
/* Sliding top ----------------------------------------------------------------------- */
#Sliding-top{position:absolute;left:0;top:0;width:100%;z-index:800}
#Sliding-top:after{content:"";height:3px;width:100%;display:block;position:absolute;left:0;bottom:-3px;z-index:1;background:url(../images/box_shadow.png) repeat-x left top}
#Sliding-top .widgets_wrapper{padding:15px 0;display:none}
#Sliding-top .widgets_wrapper .column{margin-bottom:0}
#Sliding-top .widgets_wrapper .widget{margin-bottom:0;padding:15px 0}
#Sliding-top .widgets_wrapper .widget:after{display:none}
#Sliding-top a.sliding-top-control{display:block;width:0;height:0;border-style:solid;border-width:0 45px 45px 0;border-color:transparent;position:absolute;z-index:801;right:0;bottom:-45px}
#Sliding-top a.sliding-top-control span{display:block;width:26px;height:30px;line-height:25px;text-align:center;position:absolute;right:-45px;top:0;color:#fff;font-size:18px}
#Sliding-top a.sliding-top-control .minus{display:none}
#Sliding-top a.sliding-top-control .plus{display:block}
#Sliding-top.active a.sliding-top-control .minus{display:block}
#Sliding-top.active a.sliding-top-control .plus{display:none}
#Sliding-top.st-center a.sliding-top-control{border-color:transparent;border-width:45px 45px 0;left:50%;right:auto;margin-left:-22px;margin-right:0}
#Sliding-top.st-center a.sliding-top-control span{left:-14px;top:-45px}
#Sliding-top.st-left a.sliding-top-control{border-color:transparent;border-width:45px 45px 0 0;left:0;right:auto;margin-right:0}
#Sliding-top.st-left a.sliding-top-control span{left:-3px;top:-45px}
#Sliding-top .Recent_posts ul li .desc{background:rgba(0,0,0,.1)}
#Sliding-top .widget_hkd_menu ul li a{background:rgba(0,0,0,.1);color:#ccc}
#Sliding-top .widget_recent_entries ul li{background:rgba(0,0,0,.1)}
#Sliding-top ul.list_mixed li:after,#Sliding-top ul.list_check li:after,#Sliding-top ul.list_star li:after,#Sliding-top ul.list_idea li:after{background:rgba(255,255,255,.08)}
#Sliding-top .widget_hkd_recent_comments ul li .date_label{background-color:rgba(0,0,0,.07)}
#Sliding-top .widget_hkd_recent_comments ul li .date_label:after{border-left-color:rgba(0,0,0,.07)}

/* Pager ----------------------------------------------------------------------------- */
.pager_wrapper{margin-bottom:0}
.pager{text-align:center}
.pager .pages{display:inline-block;margin:20px 30px 0;padding:4px 3px;-webkit-border-radius:5px;border-radius:5px;background-color:#f8f8f8;background-image:url(../images/stripes/stripes_3_b.png)}
.pager .pages a,.pager .pages span.page-numbers{display:inline-block;margin:0 1px;width:35px;height:35px;line-height:35px;text-align:center;-webkit-border-radius:5px;border-radius:5px}
.pager .pages a:hover{text-decoration:none}
.pager .pages a:hover,.pager .pages a.active,.pager .pages span.page-numbers.current{color:#fff}
.pager a.next_page,.pager a.prev_page{display:inline-block;line-height:43px}
.pager .pages a{-webkit-transition:all .3s ease-in-out;-moz-transition:all .3s ease-in-out;-o-transition:all .3s ease-in-out;transition:all .3s ease-in-out}
	
/* Load more button ------------------------------------------------------------------ */
.pager_lm{background:url(../images/preloader.gif) no-repeat center 17px;text-align:center}
.pager_lm .pager_load_more{margin:20px 0}
.pager_lm.loading{min-height:49px}
.pager_lm:not(.loading){background:none}

/* Pager single | blog post ---------------------------------------------------------- */
.page-pager,.post-pager{margin-bottom:0!important;}
.pager-single{text-align:center;background:rgba(0,0,0,0.02);margin-top:15px;margin-bottom:40px}
.pager-single span{height:45px;line-height:45px;display:inline-block;padding:0 9px;position:relative;font-weight:700}
.pager-single a span{font-weight:400}
.pager-single span:after{content:"";display:block;position:absolute;left:0;bottom:-1px;width:100%;height:1px}
.pager-single a span:after{display:none}

/* Fixed Navigation ------------------------------------------------------------------ */
#Content .fixed-nav{display:none}
.fixed-nav{position:fixed;bottom:40px;height:80px;z-index:90}
.fixed-nav.fixed-nav-prev{left:0}
.fixed-nav.fixed-nav-next{right:0}
.fixed-nav .arrow{display:block;width:35px;height:80px;font-size:15px;position:relative;z-index:92;color:#fff;line-height:80px;text-align:center}
.fixed-nav .photo{height:80px;width:80px;position:relative;z-index:92;overflow:hidden;line-height:0;background-color:#000}
.fixed-nav .desc{width:190px;padding:6px 15px;min-height:68px;background:#fff;z-index:91}
.fixed-nav .desc h6{margin-bottom:3px;padding-bottom:3px;border-bottom-width:1px;border-style:solid}
.fixed-nav .desc i{display:inline-block;margin-right:2px}
.fixed-nav .desc i:before{margin-left:0}

.fixed-nav-prev .arrow,.fixed-nav-prev .photo,.fixed-nav-prev .desc{float:left}
.fixed-nav-prev .desc{margin-left:-335px}
.fixed-nav-prev:hover .desc{margin-left:0}
.fixed-nav-next .arrow,.fixed-nav-next .photo,.fixed-nav-next .desc{float:right}
.fixed-nav-next .desc{margin-right:-335px}
.fixed-nav-next:hover .desc{margin-right:0}

.fixed-nav .photo,.fixed-nav .desc{-webkit-transition:all .3s ease-in-out;-moz-transition:all .3s ease-in-out;-o-transition:all .3s ease-in-out;-ms-transition:all .3s ease-in-out;transition:all .3s ease-in-out}
.fixed-nav.format-quote .desc{display:none}
.fixed-nav.format-quote .photo{background-color:#eee;background-image:url(../images/blockquote.png);background-position:center center;background-repeat:no-repeat;background-size:50% auto}
.fixed-nav.format-link .photo img{display:none}
.fixed-nav.format-link .photo{background-color:#eee;background-image:url(../images/link.png);background-position:center center;background-repeat:no-repeat}

@media only screen and (max-width: 1430px) {
	.fixed-nav-prev .photo{position:static;margin-left:-115px}
	.fixed-nav-prev:hover .photo{margin-left:0}
	.fixed-nav-next .photo{position:static;margin-right:-115px}
	.fixed-nav-next:hover .photo{margin-right:0}
}

.fixed-nav.style-images .arrow{display:none}
.fixed-nav.style-images .photo{background:#EEEEEE;margin:0;}
.fixed-nav.style-images .photo:before{font-family:'hkd-icons';position:absolute;top:50%;left:50%;transform:translate(-50%,-50%);font-size:32px;color:#ccc;transition:color .1s ease-in-out}
.fixed-nav.style-images:hover .photo:before{color:#aaa}
.fixed-nav-prev.style-images .photo:before{content:'\e8b8'}
.fixed-nav-next.style-images .photo:before{content:'\e916'}
.fixed-nav.style-images .photo img{position:relative;transition:opacity .1s ease-in-out}
.fixed-nav.style-images:hover .photo img{opacity:0}
.fixed-nav.style-images .desc{display:none}

.fixed-nav.style-arrows .arrow{display:none}
.fixed-nav.style-arrows .photo{background:#EEEEEE;margin:0;}
.fixed-nav.style-arrows .photo:before{font-family:'hkd-icons';position:absolute;top:50%;left:50%;transform:translate(-50%,-50%);font-size:32px;color:#ccc;transition:color .1s ease-in-out}
.fixed-nav.style-arrows:hover .photo:before{color:#aaa}
.fixed-nav-prev.style-arrows .photo:before{content:'\e8b8'}
.fixed-nav-next.style-arrows .photo:before{content:'\e916'}
.fixed-nav.style-arrows .photo img{display:none;}
.fixed-nav.style-arrows .desc{display:none}

/* Filters --------------------------------------------------------------------------- */
#Filters{margin-bottom:30px}
#Filters .filters_buttons{padding:15px;margin:0;font-size:100%;background-image:url(../images/stripes/stripes_5_b.png);-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;overflow:hidden}
#Filters .filters_buttons li{float:left;margin:0 15px 0 0;list-style:none}
#Filters .filters_buttons li.categories i,#Filters .filters_buttons li.tags i{margin-right:3px}
#Filters .filters_buttons li.reset{float:right;margin-right:0}

#Filters .filters_wrapper{display:none;margin-top:20px}
#Filters .filters_wrapper ul{display:none;overflow:hidden;margin:0}
#Filters .filters_wrapper ul li{display:inline-block;width:18.9%;margin:.5%;list-style:none}
#Filters .filters_wrapper ul li a{display:block;padding:7px 10px;background:#fff;border:1px solid #F7F7F7;color:#858585}
#Filters .filters_wrapper ul li a:hover,#Filters .filters_wrapper ul li.current-cat a{text-decoration:none;color:#fff}
#Filters .filters_wrapper ul li.close{width:auto!important}
#Filters .filters_wrapper ul li.close a{text-align:center;width:38px;padding:7px 0;background:#8B8B8B;border:1px solid #F7F7F7!important;color:#fff}
#Filters .filters_wrapper ul li.close a:hover{background:#545454}
#Filters .filters_wrapper li.reset-inner{display:none}

	#Filters.only .filters_buttons{display:none}
	#Filters.only .filters_wrapper{display:block}
	#Filters.only li.reset-inner{display:inline-block}
	#Filters.only li.close{display:none!important}
	#Filters.only-categories .categories{display:block}
